import React from 'react';
import {
  Container,
  Typography,
  Paper,
  Grid,
} from '@mui/material';

function Dashboard() {
  return (
    <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
      <Grid container spacing={3}>
        <Grid item xs={12}>
          <Typography variant="h4" component="h1" sx={{ mb: 2 }}>
            Dashboard
          </Typography>
          <Paper sx={{ p: 2 }}>
            <Typography variant="body1">
              Welcome to the School Vaccination Tracker dashboard. Here you can manage vaccination drives, track student vaccinations, and generate reports.
            </Typography>
          </Paper>
        </Grid>
      </Grid>
    </Container>
  );
}

export default Dashboard;
